import React, {Component} from 'react';
import { Container, Row, Col } from 'reactstrap';


class Resume extends Component {
  render(){
    return (
      <Container className="about-body">
        <Row>
            <Col align='center'>
              <h1>Resume</h1>
            </Col>
          </Row>
      </Container>
    );
  }
}

export default Resume;
